INSERT INTO `article` VALUES (2730402900,'小托马斯十佳球：小IT成毒瘤？与兰德尔发生冲突 险约架！','                    <p>　　NBA98.3月16日讯，在昨日NBA湖人与勇士的比赛中，小托马斯与兰德尔在第三节发生激烈的冲突，要不是球哥与洛佩兹在当中劝架，两人就已经动手了。并且昨日湖人面对的杜兰特率领的残阵勇士，最终湖人输掉了比赛，下面来看详细消息。</p>\n                    <p><img src=\"/public/images/img_9.png\" alt=\"\"></p>\n                    <p>然非常着急，在湖人的一次暂停中，他就对兰德尔表达了不满。</p>\n                    <p>最近很多球员都表示现在的联盟的防守强度很低，盖伊就表示现在的打法越来越软，罗斯则表示在防守端甚至都不能去碰对手，当然现在的联盟和10年前还是有一定的差距的，罗斯表示:如果乔丹在这个时代打球，然后又不能碰他，那乔丹场均可以拿多少分，当然这一直都是很多球迷议论的话，然后奥尼尔和麦迪都相继表示自己可以在这个时代轻松场均砍下40+，虽然他们作为球员时期个人能力很强，但真的就像他们所说的那样吗</p>\n                    <p>想想现在联盟最强的两个球员，也是NBA历史最佳之一的詹姆斯和杜兰特，他们在现在这个时代的联盟里打球场均才拿到27分，即使是最巅峰时期也是场均30+的得分而已，难道詹姆斯和杜兰特还不如麦迪吗，麦迪曾经说过自己在这个时代场均40分没有问题，而且詹姆斯和杜兰特都是处于生涯巅峰时期，依然是场均27+的得分而已，杜兰特在勇士不说，但詹姆斯在最近的两个赛季都是单核带队模式，也没有超过场均30+的得分，所以我们并不能说现在的联盟防守很差</p>\n                    <p><img src=\"/public/images/img_9.jpg\" alt=\"\"></p>\n                    <p>想想现在联盟最强的两个球员，也是NBA历史最佳之一的詹姆斯和杜兰特，他们在现在这个时代的联盟里打球场均才拿到27分，即使是最巅峰时期也是场均30+的得分而已，难道詹姆斯和杜兰特还不如麦迪吗，麦迪曾经说过自己在这个时代场均40分没有问题，而且詹姆斯和杜兰特都是处于生涯巅峰时期，依然是场均27+的得分而已，杜兰特在勇士不说，但詹姆斯在最近的两个赛季都是单核带队模式，也没有超过场均30+的得分，所以我们并不能说现在的联盟防守很差</p>','篮球网','2018-10-31 09:38:00',1,1,00000000000),(2730402978,'1','2','3',NULL,NULL,1,00000000000),(2730402980,'我是标题','我是文章内容','我是作者123',NULL,NULL,1,00000000000),(2730402981,'我是标题','我是文章内容','我是作者123',NULL,NULL,1,00000000000),(2730402982,'我是标题','我是文章内容','我是作者1234',NULL,NULL,1,00000000000),(2730402986,'231','213123','321',NULL,NULL,1,00000000000),(2730402988,'我是标题','我是文章内容','我是作者1234',NULL,NULL,1,00000000000),(2730402990,'我是标题','我是文章内容231','我是作者1234231321',NULL,NULL,1,00000000000),(2730402991,'更新标题测试','我是文章内容12','我是作者1234231321',NULL,NULL,1,00000000000),(2730402995,'我是标题123441212412','我是文章内容','我是作者',NULL,NULL,1,00000000000),(2730402997,'小托马斯123','<p>　　NBA98.3月16日讯，在昨日NBA湖人与勇士的比赛中，小托马斯与兰德尔在第三节发生激烈的冲突，要不是球哥与洛佩兹在当中劝架，两人就已经动手了。并且昨日湖人面对的杜兰特率领的残阵勇士，最终湖人输掉了比赛，下面来看详细消息。</p>','篮球网',NULL,NULL,1,00000000000),(2730403000,'1','1','1',NULL,NULL,1,00000000000),(2730403012,'SVCBA第18赛季报名结束','<p>Onepiece杯SVCBA第18赛季已经结束，共有<span style=\"font-weight: bold;\">22</span>支男篮球队，以及<span style=\"font-weight: bold;\">5</span>支女篮球队参加新赛季的比赛。</p><p><br></p><p>新赛季赛制与上赛季一样: 全年共进行14场比赛，包括<span style=\"font-weight: bold;\">9</span>场常规赛和<span style=\"font-weight: bold;\">5</span>场季后赛。</p><p><br></p><p>男篮常规赛采用瑞士制，常规赛前8进入季后赛A组淘汰赛，常规赛9-16进入季后赛B组淘汰赛，常规赛17-22进入季后赛C组单循环赛。</p><p><br></p><p>男篮A组B组淘汰赛中，四分之一决赛和半决赛均采取两轮定胜负，决赛单场定胜负。</p><p><br></p><p>女篮常规带采用双循环，每轮有1支球队轮空，共比赛10轮常规赛。季后赛前两轮为排位赛，淘汰1支球队，季后赛后两轮为半决赛和决赛，均为单场定胜负。</p><p><br></p><p>18赛季上半赛季比赛日期如下</p><p><span style=\"font-weight: bold; color: rgb(194, 79, 74);\">8/25, 9/8, 10/6, 10/20, 11/3, 11/17, 12/1</span></p><p><br></p><p>2019/08/23</p><p><br></p><p><img src=\"http://svcsa.org/uploads/20190901/c415794a4062aafd8ec5413e606669f3.jpg\" style=\"max-width:100%;\"></p>','SVCBA组委会','2019-08-31 03:01:05',NULL,0,00000000000),(2730403013,'Onepiece杯SVCBA18第一轮有奖竞猜结果','<p>小四以11分获得当轮最佳，并获赠棒包一盒。</p><p><br></p><p><img src=\"http://svcsa.org/uploads/20190828/19028a3de8d3663789e333b59d09da51.png\" style=\"max-width:100%;\"></p>','SVCBA组委会','2019-08-31 03:01:28',NULL,0,00000000000),(2730403015,'Onepiece杯SVCBA18第二轮有奖竞猜结果','<p>mc咕佬肉以10分获得当轮最佳，并获赠棒包一盒！大白梨以8分进步6分的成绩获得最大进步奖。总积分榜上，小蚊子，SunnyChen，RC同以18分并列第一。</p><p><br></p><p><img src=\"http://svcsa.org/uploads/20190909/1a15c234f0f1d73f3997c5a8a8facc11.png\" style=\"max-width: 100%;\"></p><style type=\"text/css\"></style>','SVCBA组委会','2019-09-08 11:06:05',NULL,0,00000000000);
