/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `RemoveMatchTeamPlayerOnDel` AFTER DELETE ON `bb_season`
FOR EACH ROW begin
if old.id>0 then
 
delete from bb_player where SeasonID = old.id;
delete from bb_match where SeasonID = old.id;
delete from bb_team where SeasonID = old.id;

end if ;
 
